import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import '../nav/nav.css'

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

export default function Nav() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="static" className="nav">
        <Toolbar>
          <Typography variant="h4">Strangers Or Not</Typography>

          <Button size="medium" variant="contained" className="toggleButtons">Toggle Colorblindness </Button>
          <Button size="medium" variant="outlined" className="toggleButtons">Toggle Dark Mode </Button>
        </Toolbar>
      </AppBar>
    </div>
  );
}

